INSERT INTO `adminnotification_inbox` VALUES ('1',1,'2017-06-21 16:29:32','Magento Community Edition 2.0.15 is Now Available with an Important PayPal Update. Upgrade by June 30, 2017 to Avoid Service Disruptions – 6/21/2017','As of June 30, 2017, PayPal Instant Payment Notifications will no longer allow you to use HTTP to post messages back to PayPal for verification. To avoid service disruptions, all merchants using PayPal and Magento 2.0.x must upgrade to Community Edition 2.0.15 by June 30, 2017. All Magento 2.1.x versions already support this change, so no update is required. The new version is available from  the Community Edition Download Page (https://magento.com/tech-resources/download) and more information is available from PayPal at https://www.paypal-knowledge.com/infocenter/index?page=content&widgetview=true&id=FAQ1916&viewlocale=en_US','https://magento.com/tech-resources/download ',0,0),('2',4,'2017-07-05 09:25:26','Magento Business Intelligence Essentials: Now Available!','Magento Business Intelligence Essentials helps you and your teams to stay on top of the most important metrics to your business. Essentials works directly with your Magento order and customer data, and provides business insights far beyond what standard web analytics tools provide.\n\nWith Essentials, you can get up and running in only a few minutes and access over 75 pre-built reports instantly. Plus, it comes with a free 7-day trial where no credit card information is required. If you decide to stay, Essentials starts at just $100/month.\n\nFor more information, visit magento.com/products/business-intelligence/essentials.','https://magento.com/products/business-intelligence/essentials',0,0),('3',4,'2016-01-13 22:52:11','Have questions? Magento has big answers at Imagine Commerce.','Big news, bigger experts, and an even bigger ecosystem. Will you be at Imagine Commerce? Join us. ','http://imagine.magento.com',0,0),('4',1,'2016-01-20 22:17:09','Important: Install Magento Community Edition 2.0.1 for Security & Functional Updates – 1/20/2016','Today, we are releasing Magento Community Edition 2.0.1 to improve the security and functionality of Magento 2.0 sites. There are no confirmed attacks related to the security issues, but certain vulnerabilities can potentially be exploited to access customer information or take over administrator sessions. Community Edition 2.0.1 also includes USPS API updates and support for PHP7.0.2, which enables dramatic performance improvements and other benefits. You can download the release from the Community Edition Download Page or by using Composer. Learn more at https://magento.com/security/patches/magento-201-security-update. \n','https://magento.com/security/patches/magento-201-security-update',0,0),('5',1,'2016-01-29 00:08:45','Important: Magento Community Edition 2.0.2 Addresses Upgrade Issues – January 28, 2016','Newly released Magento Community Edition 2.0.2 resolves issues encountered by some users when upgrading Magento Community Edition 2.0.0 and 2.0.1. The issues occur with products that were installed from a compressed archive (.tar.gz, .zip, and .bz2); merchants who used other installation options are not affected. More information is available in the Technical Bulletin at http://devdocs.magento.com/guides/v2.0/release-notes/tech_bull_201-upgrade.html. ','http://devdocs.magento.com/guides/v2.0/release-notes/tech_bull_201-upgrade.html',0,0),('6',1,'2016-03-31 00:24:35','Magento Community Edition 2.0.3 Includes Functional and Security Updates – 3/30/2016','Magento Community Edition 2.0.3 is now available and contains important security updates, as well as performance improvements and functional enhancements. Full details on the functional enhancements are included in the release notes at http://devdocs.magento.com/guides/v2.0/release-notes/ReleaseNotes2.0.3CE.html. More information on the security updates can be found on the Magento Security Center at https://magento.com/security/patches/magento-203-security-update.','https://magento.com/security/patches/magento-203-security-update',0,0),('7',1,'2016-04-01 06:40:23','New Release: Magento Community Edition 2.0.4 – 3/31/2016','We have released Magento Community Edition 2.0.4 to address a packaging issue with yesterday’s release. If you have already installed Enterprise Edition 2.0.3, you must replace it with the new version to ensure that your site receives all security enhancements. Learn more at https://magento.com/security/patches/magento-204-security-update','https://magento.com/security/patches/magento-204-security-update',0,0),('8',1,'2016-05-18 16:43:59','Community Edition 2.0.6 Provides Important Security and Functional Updates – 5/18/2016','Magento Community Edition 2.0.6 is now available and contains important security and functional improvements. More information on the security updates can be found on the Magento Security Center at https://magento.com/security/patches/magento-206-security-update. More information on the functional enhancements is provided in the release notes: http://devdocs.magento.com/guides/v2.0/release-notes/ReleaseNotes2.0.6CE.html','https://magento.com/security/patches/magento-206-security-update',0,0),('9',4,'2016-05-22 18:41:58','Repo.magento.com is currently unavailable. We are working to resolve this issue as quickly as possible – 5/22/16, 11:40 am PT','Users currently cannot access Magento 2 code updates from Repo.magento.com. We are investigating the issue and will update you when it is resolved. As an alternative, you can still access Magento 2 code from GitHub (https://github.com/magento/magento2) or from the Community Edition download page (https://www.magentocommerce.com/download). ','https://github.com/magento/magento2',0,0),('10',4,'2016-05-22 23:12:08','Issue with repo.magento.com has been resolved - 5/22/16, 4 pm PT','The issue with repo.magento.com has been resolved. You should be able to access Magento 2 code updates at this time.','http://devdocs.magento.com/guides/v2.0/install-gde/prereq/integrator_install.html',0,0),('11',4,'2016-05-24 14:08:30','New release: Magento Community Edition 2.0.7 Resolves Payment Gateway Issues – 5/24/16 ','Magento Community Edition 2.0.7 is now available. It resolves payment gateway issues experienced when using PHP 7.0.3. Review the release notes for more information: http://devdocs.magento.com/guides/v2.0/release-notes/ReleaseNotes2.0.7CE.html.','http://devdocs.magento.com/guides/v2.0/release-notes/ReleaseNotes2.0.7CE.html',0,0),('12',4,'2016-06-06 21:44:09','New Community Edition 2.0.7 Patch (MDVA-449) for Merchants Using PHP 5.5.x – June 6, 2016 ','A new patch, MDVA-449, enables merchants using Community Edition 2.0.7 and PHP 5.5.x to upgrade to future releases. It corrects a line of code in the Setup application that is packaged with Community Edition 2.0.7 that is not compatible with PHP 5.5.x. Merchants using Community Edition 2.0.7 with PHP 5.6.x and 7.0.x DO NOT need this patch. Learn more at http://devdocs.magento.com/guides/v2.0/release-notes/tech_bull_207-upgrade.html ','http://devdocs.magento.com/guides/v2.0/release-notes/tech_bull_207-upgrade.html ',0,0),('13',4,'2016-06-22 22:29:31','New Community Edition 2.0.x Patch (MDVA-532) Enables Upgrades to Magento 2.1 – June 22, 2016','A new patch, MDVA-532, enables merchants using Magento Community Edition 2.0.x to upgrade to Magento 2.1 Community Edition Release Candidates or GA software. More information about the patch and important instructions for command-line upgrades to Magento 2.1 when sample data is installed are available in a technical bulletin posted at http://devdocs.magento.com/guides/v2.0/release-notes/tech_bull_21-upgrade.html.','http://devdocs.magento.com/guides/v2.0/release-notes/tech_bull_21-upgrade.html',0,0),('14',4,'2016-06-23 16:44:46','Increase your sales and productivity, while simplifying PCI compliance with exciting new Magento Community Edition 2.1 features.','Shoppers can now check out faster using credit cards stored with PayPal and a redesigned PayPal checkout. PCI compliance is easier thanks to Braintree Hosted Fields. Admin tools are redesigned to help you work more efficiently. Upgrade to Enterprise Edition for new Content Staging and Preview and Enhanced Site Search capabilities.','https://magento.com/blog/magento-news/magento-enterprise-edition-21-unleashes-power-marketers-and-merchandisers ',0,0),('15',4,'2016-07-22 18:56:40','Community Edition 2.0.8 improves installation, configurable product creation and more – 7/19/2016','Magento Community Edition 2.0.8 makes several functional improvements that address issues with application installation, duplication of url keys during configurable product creation, and other issues described in the release notes posted at http://devdocs.magento.com/guides/v2.0/release-notes/ReleaseNotes2.0.8CE.html.','http://devdocs.magento.com/guides/v2.0/release-notes/ReleaseNotes2.0.8CE.html',0,0),('16',4,'2016-08-10 22:27:44','Community Edition 2.0.9 Improves Performance and Product Quality ','Community Edition 2.0.9 is now available and improves storefront performance when a large number of configurable product variations are used and resolves issues with price and tax calculations, mini-cart displays and more. You can learn more in the release notes at http://devdocs.magento.com/guides/v2.0/release-notes/ReleaseNotes2.0.9CE.html ','http://devdocs.magento.com/guides/v2.0/release-notes/ReleaseNotes2.0.9CE.html',0,0),('17',4,'2016-08-30 16:36:54','Community Edition 2.1.1 Features Performance and Functional Improvements – 8/30/2016','Community Edition 2.1.1 improves storefront performance when using many configurable product variations and addresses upgrade and installation issues. You can learn more in the release notes at http://devdocs.magento.com/guides/v2.1/release-notes/ReleaseNotes2.1.1CE.html.','http://devdocs.magento.com/guides/v2.1/release-notes/ReleaseNotes2.1.1CE.html ',0,0),('18',1,'2016-10-12 20:27:35','Community Edition 2.0.10 and 2.1.2 Resolve Critical Security Issues – 10/12/2016','Magento Community Edition 2.0.10 and 2.1.2 resolve multiple security issues, including critical vulnerabilities with certain payment methods and Zend Framework libraries. The releases also make several functional improvements and API enhancements. Learn more about the security issues in the Magento Security Center at https://magento.com/security/patches/magento-2010-and-212-security-update and functional updates at http://devdocs.magento.com/guides/v2.1/release-notes/bk-release-notes.html.','https://magento.com/security/patches/magento-2010-and-212-security-update',0,0),('19',1,'2016-10-25 16:53:36','Dirty COW Linux OS Vulnerability – 10/25/2016','Dirty COW (CVE-2016-5195) is a serious vulnerability affecting most Linux Operating Systems that can be exploited to gain root access to the server. More information on how to immediately update your Linux OS is available in the Magento Security Center at https://magento.com/security/vulnerabilities/new-linux-operating-system-vulnerability. ','https://magento.com/security/vulnerabilities/new-linux-operating-system-vulnerability',0,0),('20',4,'2016-12-14 18:39:37','New Magento 2 Releases Feature Payment, Performance & Quality Enhancements – 12/14/2016','Community Editions 2.1.3 and 2.0.11 feature new payment functionality, accelerated performance, and enhanced product quality. Learn more in the release notes at http://devdocs.magento.com/guides/v2.1/release-notes/bk-release-notes.html ','http://devdocs.magento.com/guides/v2.1/release-notes/bk-release-notes.html',0,0),('21',1,'2017-01-14 02:33:07','New Zend Framework Security Vulnerability – 1/13/2017','We’ve found a new vulnerability in a Zend Framework 1 and 2 email component used by all Magento 1 and Magento 2 software (as well as other PHP solutions). This vulnerability is serious and can lead to a remote code execution attack if your servers use Sendmail as a mail transport agent. Learn how to protect your sites at https://magento.com/security/news/new-zend-framework-1-security-vulnerability\n\n','https://magento.com/security/news/new-zend-framework-1-security-vulnerability',0,0),('22',4,'2017-01-19 16:59:15','New Magento DevBox Beta Speeds Magento 2 Setup – 1/19/2017','Magento DevBox Beta makes it faster and easier than ever to setup your Magento 2 development environment. Read our blog post to find out more at: https://magento.com/blog/technical/set-your-magento-2-development-environment-faster.','https://magento.com/blog/technical/set-your-magento-2-development-environment-faster',0,0),('23',1,'2017-02-07 20:02:30','Community Editions 2.1.4 and 2.0.12 Resolve Zend Framework Security Issue & Enhance Product Quality – 2/7/2017','Community Editions 2.1.4 and 2.0.12 address the recent Zend Framework 1 security vulnerability and improve catalog, payments, and sales modules. Review the release notes for more information:  http://devdocs.magento.com/guides/v2.1/release-notes/bk-release-notes.html','http://devdocs.magento.com/guides/v2.1/release-notes/bk-release-notes.html',0,0),('24',4,'2017-02-17 21:09:01','Inspirational athlete, Serena Williams, will join Magento at Imagine 2017.','Imagine 2017 will bring together 3000+ international commerce experts to exchange ideas on the future of commerce. Don’t miss this opportunity to hear from inspirational athlete, Serena Williams, and Stella & Dot CEO, Jessica Herrin. Join us in Las Vegas, April 3-5. Register now at https://imagine.magento.com/\n','https://imagine.magento.com/',0,0),('25',4,'2017-02-21 17:06:57','Community Editions 2.1.5 and 2.0.13 Update Magento Copyright – 2/21/2017','Community Editions 2.1.5 and 2.0.13 contain 2017 copyright updates. That’s it. Nothing else. Isolating these changes in a single release is intended to simplify future updates and developer workflow. For more information, please review the release notes:   http://devdocs.magento.com/guides/v2.1/release-notes/bk-release-notes.html.','http://devdocs.magento.com/guides/v2.1/release-notes/bk-release-notes.html',0,0),('26',4,'2017-04-11 16:46:39','Community Edition 2.1.6 Accelerates Performance – 4/11/2017','Community Edition 2.1.6 includes several exciting performance enhancements and optimizations to category pages, layered navigation, and image resizing. Review the release notes for more information: http://devdocs.magento.com/guides/v2.1/release-notes/bk-release-notes.html','http://devdocs.magento.com/guides/v2.1/release-notes/bk-release-notes.html',0,0),('27',1,'2017-05-31 20:01:16','Community Editions 2.1.7 and 2.0.14 Security Enhancements – 5/31/2017','Community Edition 2.1.7 and 2.0.14 include critical security enhancements, provide support for MasterCard BIN range updates, and revert image resizing changes from Enterprise 2.1.6. Review the release notes for more information: http://devdocs.magento.com/guides/v2.1/release-notes/bk-release-notes.html','http://devdocs.magento.com/guides/v2.1/release-notes/bk-release-notes.html',0,0),('28',2,'2017-09-11 22:52:15','USPS Name Change Impacts “First-Class Mail Parcel” Service – 09/11/2017','USPS changed their “First-Class Mail Parcel” Service to “First-Class Package Service – Retail.” Merchants offering this service must change the name, as “First-Class Mail Parcel” will no longer work. Magento is working on a code update to support this change. In the meantime, information about a workaround is available at http://devdocs.magento.com/guides/v2.1/release-notes/tech_bull_USPS-patch-Sept2017.html','http://devdocs.magento.com/guides/v2.1/release-notes/tech_bull_USPS-patch-Sept2017.html ',0,0),('29',1,'2017-09-14 23:12:36','Important Magento Open Source 2.1.9 and 2.0.16 Security Enhancements – 9/14/2017','Magento Open Source 2.1.9 and 2.0.16 include critical security enhancements and address the September 1 changes to USPS shipping. Please update your site as soon as possible. More information is available in the release notes: \n http://devdocs.magento.com/guides/v2.1/release-notes/bk-release-notes.html.\n','http://devdocs.magento.com/guides/v2.1/release-notes/bk-release-notes.html',0,0),('30',4,'2017-09-26 22:42:42','Magento Open Source 2.2 Delivers Enhanced Commerce Capabilities – 9/26/2017','Magento Open Source 2.2 includes a range of platform enhancements, including a new deployment process that minimizes production downtime, optimized performance, platform updates that improve developer experience, and Magento Social marketing tools. Learn more at http://devdocs.magento.com/guides/v2.2/release-notes/bk-release-notes.html.','http://devdocs.magento.com/guides/v2.2/release-notes/bk-release-notes.html ',0,0),('31',4,'2019-04-12 03:12:15','Deprecation Notice','Catalog Search is currently configured to use the MySQL engine, which has been deprecated. Consider migrating to one of\nthe Elasticsearch engines now to ensure there are no service interruptions during your next upgrade.','',0,0),('32',1,'2019-03-01 20:19:18','Action required: Update Authorize.Net Direct Post from MD5 to SHA-512 – 3/1/2019','Magento\'s implementation of the Authorize.Net Direct Post payment method uses MD5 based hash, and on March 14, 2019 Authorize.net will stop supporting MD5 based hash usage. This will result in Magento merchants not being able to process payments using Authorize.Net Direct Post. To avoid disruption and to continue processing payments, merchants need to apply a patch provided by Magento and add a Signature Key (SHA-512) in the Magento Admin configuration settings. For information on applying this patch please see the Magento Help Center.\n\nhttps://support.magento.com/hc/en-us/articles/360024368392','https://support.magento.com/hc/en-us/articles/360024368392',0,0),('33',4,'2019-03-20 03:53:15','Is it time to take your Magento Open Source commerce to the next level? ','We’re here to help! Magento Commerce Cloud gives you access to Page Builder, a powerful drag-and-drop content creation and editing tool that allows you to quickly design, test and launch new content with no coding or developer support required. Check it out with a free demo today.  http://bit.ly/2HwGsBs ','http://bit.ly/2HwGsBs',0,0),('34',1,'2019-03-26 18:05:01','Magento Open Source 2.3.1 delivers Powerful New Merchant and Developer Experience Enhancements – 3/26/2019','The latest release of Magento Open Source empowers merchants to act more quickly, operate more efficiently, and scale their businesses. Magento 2.3.1 also delivers important security enhancements and performance improvements. With these important updates we strongly recommend that you upgrade to ensure your sites maintain the highest level of security. You can review the release notes for more information about all of the enhancements.','https://devdocs.magento.com/guides/v2.3/release-notes/bk-release-notes.html',0,0),('35',4,'2019-06-03 19:54:35','Drive cart conversion and revenue with Magento Shipping','Provide the shipping and pickup options required to compete. Meet customer expectations, drive conversion, increase revenue, and lower abandonment. Learn more: http://bit.ly/2DtWitd','http://bit.ly/2DtWitd',0,0),('36',1,'2019-06-25 16:09:17','Important Security and Performance Updates Released in Magento 2.3.2','The latest releases of Magento include important security enhancements along with performance and productivity improvements. We strongly recommend that you upgrade to ensure your sites maintain the highest level of security. You can review the release notes for more information about all of the enhancements and information on security updates included in these versions of Magento at our Security Center: https://magento.com/security/','https://devdocs.magento.com/guides/v2.3/release-notes/bk-release-notes.html',0,0),('37',4,'2019-08-27 14:06:49','Breaking news! Adobe (Magento) is recognized by Gartner as a Leader based on Magento Commerce in the 2019 Magic Quadrant for Digital Commerce. ','Learn why Magento Commerce is a Leader for a third year in a row 