ment. For more information please visit our release notes. https://devdocs.magento.com/guides/v2.3/release-notes/bk-release-notes.html ','https://devdocs.magento.com/guides/v2.3/release-notes/bk-release-notes.html',0,0),('42',4,'2019-10-23 12:49:48','eBook: Advanced Strategies for Fast-Tracking Revenue Growth','Take your business in a new direction by selling more to a larger audience. Our guide explains 5 ways you can quickly add new revenue streams to your business. Link here: http://bit.ly/2m6svAN','http://bit.ly/2m6svAN',0,0),('43',4,'2019-12-02 15:09:11','2020: The Year You Reimagine Your Mobile Platform','Smarter, faster mobile shopping experiences are now achievable with Progressive Web App technology. Forrester reveals how to leverage this next-generation technology, now available on Magento Commerce 2. Reimagine your mobile environment with this exclusive report.  Link here: http://bit.ly/2W5r4zg','http://bit.ly/2W5r4zg ',0,0),('44',4,'2019-12-09 18:08:56','Online B2B purchases are set to skyrocket to $9 trillion in the US alone this year. Get in on the action with B2B and B2C selling.','The lines between B2B and B2C commerce are blurring. Here’s 5 reasons to go hybrid with your commerce strategy in 2020. http://bit.ly/2DPgAx0','http://bit.ly/2DPgAx0',0,0),('45',4,'2019-12-16 18:39:06','Did you know? A whopping 89% of B2B businesses now rely on digital content to guide their purchasing process.','Learn how you can integrate compelling content into your B2B sales strategy with our latest eBook. Download Now: http://bit.ly/368QIbu','http://bit.ly/368QIbu',0,0),('46',4,'2020-01-02 18:26:08','Are you set up to achieve your eCommerce goals? Make upgrading your resolution for 2020.','Upgrading to Magento Commerce might cost less than you think. Watch our webinar to learn the true cost savings of upgrading to Magento Commerce 2. Watch Now: http://bit.ly/2BcYK5A','http://bit.ly/2BcYK5A',0,0),('47',1,'2020-01-08 03:17:12','Attention! You use an ancient version of Blog Extension. It is strongly recommended to update Blog Extension to the newest version 2.9.1',' \n                                    https://magefan.com/magento2-blog-extension?ancient=2.8.0                                 ','https://magefan.com/magento2-blog-extension?ancient=2.8.0',0,0),('48',4,'2020-01-08 03:17:12','FAQ: How to configure &quot;read more&quot; in your Magento 2 blog post',' If you still don\'t know how to configure read more functionality in your magento 2 blog post, please read this article.\n                    Online documentation for Magento 2 blog extension is also available on our website. http://goo.gl/XOEdpy ','http://magefan.com/blog/add-read-more-tag-to-blog-post-content/?from=notification1',0,0),('49',4,'2020-01-08 03:17:12','NEW Magento 2 Alternate Hreflang Tags Extension with Better Store Switcher\n    ',' Do you manage Magento multi-language store without using Hreflang tags? You should definitely enable them. ','https://magefan.com/magento2-alternate-hreflang-extension',0,0),('50',4,'2020-01-13 18:02:52','eCommerce is an ocean of opportunity. Take our quiz and find out if you are a pilot fish, octopus, or shark.','Find out if you’re ready to sell with the big fish by taking our brief quiz designed to identify your competitive selling potential. Answer our set of quick questions to see where you stack up and receive personalized resources to give your digital growth strategy some teeth. http://bit.ly/2NkNvhS','http://bit.ly/2NkNvhS',0,0),('51',4,'2020-08-12 11:41:11','Disable Notice','To improve performance, collecting statistics for the Magento Report module is disabled by default. \nYou can enable it in System Config.','',0,0),('52',3,'2020-08-12 11:53:25','New version 2.9.6 of Magefan Magento 2 Blog Extension is now available.',' You can download the new version from Magefan Store or update it via composer. Get us in touch if you need our help with an update or you have any questions.\n                                    https://magefan.com/magento2-blog-extension?version=2.9.6\n                                 ','https://magefan.com/magento2-blog-extension?version=2.9.6',0,0),('53',4,'2020-08-12 11:53:25','NEW Magento 2 Multi-Blog Extension ',' Magento 2 Multi Blog extension is the extension that allows you to have 2 separate blogs on your Magento 2 store and manage them from one admin panel. This extension could be useful for those who already use Magento 2 Blog and want to improve their store with the second blog. ','https://magefan.com/magento-2-multi-blog-extension',0,0),('54',4,'2020-08-24 17:19:20','We would love your input on Magento Payments','We value the perspective of our users and we would appreciate if you took this short survey on Magento Payments. Your response will influence the design of the next generation Magento Payments solution. https://bit.ly/2CXZro2','https://bit.ly/2CXZro2',0,0),('55',4,'2020-01-27 16:01:40','Learn The 6 Sweet Features Behind Every Irresistible eCommerce Experience. ','92% percent of online shoppers call it quits before checkout over poor site performance. Discover the six essential features your commerce platform needs to create truly memorable customer moments. Link here: http://bit.ly/2RrcS4d\n','http://bit.ly/2RrcS4d',0,0),('56',1,'2020-01-28 20:09:22','Magento Open Source 2.3.4 delivers important security updates and features to help you build a more engaging customer experience – 1/28/2020','The latest releases of Magento Open Source – 2.3.4, 2.3.3-p1, and 2.2.11 – are now generally available. The latest release of Magento Open Source includes important security enhancements along with new functionality and platform quality improvements. With these important updates we strongly recommend that you upgrade to ensure your sites maintain the highest level of security. You can review the release notes for more information about all of the enhancements. Learn how this release can help you build a more engaging customer experience at Magento.com/blog.','https://devdocs.magento.com/guides/v2.3/release-notes/bk-release-notes.html',0,0),('57',4,'2020-02-10 16:41:26','Are you putting off integrating your ERP and eCommerce?','Get started on the journey to a more integrated and profitable eCommerce business. Download our comprehensive guide, eCommerce + ERP: Better Together. http://bit.ly/33XMHVV','http://bit.ly/33XMHVV',0,0),('58',4,'2020-02-28 14:39:26','2020 goal: Is your product content keeping up with your customers?','Magento Page Builder gives you fast content updates and even faster growth. Download our eBook to learn more. Link here: http://bit.ly/2NyTuQf','http://bit.ly/2NyTuQf',0,0),('59',1,'2020-03-05 21:25:23','Retrieving data. Wait a few seconds and try to cut or copy again.','&quot;We have discovered an error in Magento 2.3.4 that can prevent a shopper from completing an order when using PayPal Express Checkout. The issue occurs for any country where the region field in the address section is a text field (as opposed to a drop-down menu).\nWe have released a hotfix to resolve this issue and recommend that merchants on Magento version 2.3.4 who are also using PayPal Express Checkout download and apply this hotfix as soon as possible to prevent further errors. Please refer to our help center for instructions and troubleshooting. A fix for this issue will be included in Magento 2.3.5.','https://support.magento.com/hc/en-us/articles/360039451972',0,0),('60',4,'2020-03-20 15:03:20','Simplify and accelerate your content updates with Page Builder','Content is critical to eCommerce engagement. In fact, 87 percent of shoppers say product content has a high impact on their purchasing decisions. Page Builder delivers a drag-and-drop content creation and management tool which simplifies your website updates from start to finish. Learn how this powerful creative tool can grow your business. Link here: http://bit.ly/2NyTuQf','http://bit.ly/2NyTuQf',0,0),('61',1,'2020-03-24 16:02:43','Important Hot Fix Available for Magento Commerce 2.3','A new Hot Fix is available to close a security issue in Magento Open Source 2.3, all versions. We recommend that users of potentially affected deployments take immediate action by updating your Magento installation with the latest patch. Please review our Security Blog via the included link for more information about the bug and how to apply the Hot Fix.','https://magento.com/security/hot-fix-available-cve-2019-8118',0,0),('62',4,'2020-04-08 16:41:38','Watch On-Demand Webinar: Seize the New Year– 5 Growth Strategies for 2020.','Magento experts Shannon Hane and Matthew Wasley from Adobe will share the latest eCommerce strategies to accelerate revenue growth in 2020. Watch now: http://bit.ly/2GPpb4b','http://bit.ly/2GPpb4b',0,0),('63',4,'2020-04-10 17:14:30','Watch On-On Demand: The True Cost Savings of Magento Commerce 2.','Join us for The True Cost Savings of Magento Commerce 2 webinar on April 23rd. John Glasgow and Matt Boland from Adobe will discuss how your business can reduce operating costs and grow revenue. Leading solution partner Atwix will also share how they are helping customers launch innovative solutions to meet expectations in today’s environment. Register Now: https://bit.ly/2JRgJCX','https://bit.ly/2JRgJCX',0,0),('64',4,'2020-04-14 22:03:09','Upgrade to Magento Commerce with no payments for the first 3 months. ','Adobe is committed to supporting merchants during this challenging time. Upgrade to Magento Commerce 2 quickly and affordably with limited time offers. Pay nothing for the first 3 months, and our Magento Commerce launch package will get you up and running fast. Free Magento U classes will ensure your teams are fully equipped to take their digital operations to the next level. Learn more: https://bit.ly/2RBnk8M','https://bit.ly/2RBnk8M',0,0),('65',1,'2020-04-28 18:29:06','Magento Open Source 2.3.5-p1 delivers important security updates and features ','The latest releases of Magento Open Source – 2.3.5-p1 and 2.3.4-p2 – are now generally available. The latest release of Magento Open Source includes important security enhancements along with new functionality and platform quality improvements. With these important updates we strongly recommend that you upgrade to ensure your sites maintain the highest level of security. You can review the release notes for more information about all of the enhancements. Learn how this release can help you save time and maximize resources at Magento.com/blog. ','https://devdocs.magento.com/guides/v2.3/release-notes/bk-release-notes.html',0,0),('66',4,'2020-05-04 18:02:10','One Platform to Rule them All','The lines between B2B and B2C commerce are blurring. B2C companies are adding wholesale storefronts while their traditionally B2B counterparts are increasingly selling direct to consumers.','http://bit.ly/2DPgAx0',0,0),('67',4,'2020-05-11 23:43:35','5 Ways You Can Deliver Commerce to Your Customers','Now more than ever, eCommerce is helping individuals and communities satisfy their most essential needs. Discover the 5 ways brands are bringing commerce to their customers in our eGuide, The New Everywhere (and Every Device) Commerce. Learn more: https://bit.ly/2YIrL6l','https://bit.ly/2YIrL6l',0,0),('68',4,'2020-05-19 23:51:00','Watch our live webinar on-demand: Fast-Track Your Move to Magento Commerce.','Watch our on-demand webinar: Fast-Track Your Move to Magento Commerce. 5x Magento Master, Brent Peterson, will share insider advice on getting your new Magento Commerce site to market in 30 days or less. Also, Tricia Lee from Adobe will cover limited-time offers designed to help merchants upgrade quickly and affordably. View now: https://bit.ly/2L1lxpW','https://bit.ly/2L1lxpW',0,0),('69',4,'2020-06-08 16:43:12','Find out why Forrester positioned Adobe as a Leader in their latest B2B commerce report.','Read why Adobe was named a Leader in the “Forrester Wave: B2B Commerce Suites, Q2 2020,” and discover how we can support your business with our global partner ecosystem. https://bit.ly/2z845hk','https://bit.ly/2z845hk',0,0),('70',4,'2020-06-11 18:19:15','Ask us your questions during our upcoming webinar, The True Cost Savings of Magento Commerce 2.','Join us on Tuesday, June 23rd, for a new session of The True Cost Savings of Magento Commerce 2 now with extended time for live Q&amp;A. John Glasgow from Adobe will share how your business can reduce operating costs and grow revenue. And Slava Kravchuk from Atwix, # 1 Contributing Partner, will share a customer case study leading the way in innovative B2B retail experiences. Register Now: https://bit.ly/3dLYlsN','https://bit.ly/3dLYlsN',0,0),('71',4,'2020-06-16 19:19:54','Your input requested: Shipping &amp; Fulfillment','We would like to get your feedback on how you think about and manage your shipping &amp; fulfillment so we can build great features for you! http://selfserve.decipherinc.com/survey/selfserve/9d5/200603','http://selfserve.decipherinc.com/survey/selfserve/9d5/200603',0,0),('72',4,'2020-06-25 21:45:31','We’re proud to be recognized as Leader in B2C commerce by Forrester in their latest report. ','Read the latest “Forrester Wave: B2C Commerce Suites, Q2 2020” report to learn why “Adobe leads with flexibility, supported by a strong global partner ecosystem.” https://bit.ly/370vz4V','https://bit.ly/370vz4V',0,0),('73',4,'2020-06-26 17:15:35','Embrace digital change with insights from eCommerce leaders at Adobe Experience Maker&#039;s Live July 22-23.','Take part in 40+ diverse sessions at Experience Makers Live July 22-23, with topics including Magento Commerce product roadmap, delivered by John Stockton, Sr. Director of Product Marketing at Adobe, customer case studies highlighting real-world applications of Magento Commerce features and functionality, and how Magento Commerce is helping merchants adapt to the challenges of a new digital reality. Register today! https://adobe.ly/3i7XGnK','https://adobe.ly/3i7XGnK',0,0),('74',4,'2020-07-10 00:56:40','Is Your Website Selling as Much as It Can? Take our commerce self-assessment and uncover opportunities to improve conversion rates.','An engaging user experience is essential to converting casual visitors into loyal customers. Find out if your eCommerce environment inspires long-term loyalty with our commerce self-assessment which asks, Is Your Website Selling as Much as It Can? Download now: https://bit.ly/3gt16Qk','https://bit.ly/3gt16Qk',0,0),('75',4,'2020-07-21 15:55:36','Meet the Magento Commerce Interactive Product Experience.','Meet the world’s most flexible eCommerce platform by immersing yourself in the Magento Commerce Interactive Product Experience. This interactive simulation demonstrates the powerful functionality helping merchants sustain – and grow – their business. Start Product Tour: https://adobe.ly/3eR7kZ3','https://adobe.ly/3eR7kZ3',0,0),('76',4,'2020-07-28 16:12:12','Tell us about your experience with Magento','We want to hear from you! Please take a short survey about your experience using Magento Admin. Your feedback will help us improve our products and develop new features.  http://selfserve.decipherinc.com/survey/selfserve/9d5/200508?list=1','http://selfserve.decipherinc.com/survey/selfserve/9d5/200508?list=1',0,0),('77',1,'2020-07-28 16:17:11','Magento Open Source 2.4 delivers important security updates and features to accelerate your business in the changing commerce landscape – 7/28/2020','The latest releases of Magento Open Source – 2.4 and 2.3.5-p2 – are now available. The latest release of Magento Open Source includes important security enhancements along with new functionality and platform quality improvements. With these important updates we strongly recommend that you upgrade to ensure your sites maintain the highest level of security. You can review the release notes for more information about all of the enhancements. Learn how this release can help you adapt to the changing commerce landscape at Magento.com/blog.','https://devdocs.magento.com/guides/v2.4/release-notes/bk-release-notes.html',0,0),('78',4,'2020-07-31 16:37:31','Is Your Website Selling as Much as It Can? Join our upcoming webinar and learn how to turn your website into a conversion machine.','Join us on August 13 for our webinar: Is Your Website Selling As Much As It Can? Digital Strategist Ereika Stimley and eCommerce Consultant Corey Gelato will walk you through a website self-assessment and live demo that will help you uncover opportunities to increase conversions and grow revenues. Register now: https://bit.ly/2PcjcL3','https://bit.ly/2PcjcL3',0,0),('79',4,'2020-08-07 20:57:02','The Essentials of an Unforgettable Customer Experience','Learning what’s shaping tomorrow’s shopping experiences is essential for growth. Download our eBook full of advice about crafting a better buying journey using Magento Commerce and other key technologies. Download now: https://bit.ly/31tNXkq','https://bit.ly/31tNXkq',0,0);
